import React from 'react';

const Footer = () => {
  return (
    <div className='footer'>
      <nav
        className='navbar navbar-light app'
        style={{ backgroundColor: '#A9B9C4' }}
      >
        <footer style={{ textAlign: 'center', marginLeft: '42%' }}>
          <i className='material-icons footer-icon-position'>copyright</i>react
          app 2020
        </footer>
        <hr />
        {/* <p>{props.footerText}</p> */}
      </nav>
    </div>
  );
};

export default Footer;
